pragma solidity ^0.6.1;
pragma experimental "ABIEncoderV2";

contract Test {

    bytes32 public constant WRAPPER_PROGRAM_CODE_HASH = keccak256(abi.encode(0));                  //0x290decd9548b62a8d60345a988386fc84ba6bc95484008f6362f93160ef3e563
    address public ATTESTATION_AUTHORITY = 0x1dF62f291b2E969fB0849d99D9Ce41e2F137006e; 
    bytes32 public incrementalHash = 0;
    bool public success = false;
    bytes32 public lastHash = 0;

    event TransactionData(bytes rawData, address sender, uint value, bytes32 rawDataHash);

    function testRawData(uint256 testValue) public payable {

        incrementalHash = keccak256(abi.encode(incrementalHash, msg.data, msg.sender, msg.value));

        emit TransactionData(msg.data, msg.sender, msg.value, keccak256(msg.data));

    }

    function testRawDataWithoutValue(uint256 testValue) public {

        incrementalHash = keccak256(abi.encode(incrementalHash, msg.data, msg.sender, 0));

        emit TransactionData(msg.data, msg.sender, 0, keccak256(msg.data));

    }

    function verifyAttestWithoutPrefix(address teeSignatureAddress, bytes memory teeEncryptionKey, bytes memory attestationSignature) public {
        success = verifySignature(abi.encode("Furious-Attest", WRAPPER_PROGRAM_CODE_HASH,  teeSignatureAddress, teeEncryptionKey),attestationSignature,ATTESTATION_AUTHORITY);
    }

    function verifyAttest(address teeSignatureAddress, bytes memory teeEncryptionKey, bytes memory attestationSignature) public {
        success = verifySignature(abi.encode("Furious-Attest", WRAPPER_PROGRAM_CODE_HASH, teeSignatureAddress, teeEncryptionKey),attestationSignature,ATTESTATION_AUTHORITY);
    }

    function verifySignatureWithoutPrefix(bytes memory _encodedInput, bytes memory _signature, address _party) public pure returns (bool){

        //Convert signatures
        (uint8 v, bytes32 r, bytes32 s) = abi.decode(_signature, (uint8, bytes32, bytes32));

        return _party == ecrecover(keccak256(_encodedInput), v,r,s);

    } 

    function verifySignature(bytes memory _encodedInput, bytes memory _signature, address _party) public pure returns (bool){

        //Convert signatures
        (uint8 v, bytes32 r, bytes32 s) = abi.decode(_signature, (uint8, bytes32, bytes32));

        //Calc prefixed hash
        bytes32 _hash = keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", keccak256(_encodedInput)));

        return _party == ecrecover(_hash, v,r,s);

    }
}
